import collections
def lastNonEmptyString(s):
    # "aabcbbca"
    def checkHash(h):
        for key in h:
            if len(h[key])==0:
                continue
            if len(h[key])!=1:
                return False
        return True
    hash=collections.defaultdict(list)
    for i in range(len(s)):
        hash[s[i]].append(i)
    l=-1
    for key in hash:
        hash[key] = hash[key][::-1]
        l=max(l,len(hash[key]))
    for _ in range(l):
        # print(hash)
        if checkHash(hash):
            break
        for key in hash:
            if hash[key]:
                hash[key].pop()         
    newArr  = sorted(hash.items(),key=lambda x:x[1][0] if x[1] else -1)
    # print(newArr)
    res = ""
    for n in newArr:
        c , i = n
        if i:
            res+=c
    return res


print(lastNonEmptyString(""))